import React from 'react';

function Lineup({name, picture}) {
  return (
    <div>
      <h1>Today's player is {name}</h1>
      <img src = {picture} />
    </div>
  );
}

function RenderLineup(player) {
  console.log(player);
  return <Lineup name = {player.name} pucture = {player.image} />
}

const roaster = [
  {
    name: 'Messi',
    image: './lineup1.jpg'
  },
  {
    name: 'Suarez',
    image: './lineup2.jpg'
  }
];

function App() {
  return (
    <div>
      {roaster.map(RenderLineup)}
    </div>
  );
}

export default App;
